# 프로그래머스 코딩테스트 데모# if 문에서# not in list ~안에 없는가?# in list ~안에 있는가?# 활용def solution(v):    answer = []    li1 = []    li2 = []    for i in v:        if i[0] not in li1:            li1.append(i[0])        else:            li1.remove(i[0])        if i[1] not in li2:            li2.append(i[1])        else:            li2.remove(i[1])    answer = li1 + li2    return answerif __name__ == "__main__":    v = [[1, 4], [3, 4], [3, 10]]    print(solution(v))